import React from 'react'
import {Nav, NavbarContainer, NavLogo} from './NavbarElements'


const Navbar = () => {
  return (
    <>
        <Nav>
            <NavbarContainer>
                <NavLogo href="https://th.bing.com/th/id/R.db17e01e088f1fad6ca6d697b11df350?rik=hrStb6AOWZiRdg&riu=http%3a%2f%2f3.bp.blogspot.com%2f-vLaCfFUJ5Uk%2fUjMwWy9eeVI%2fAAAAAAAABIY%2fV7f_UH0csJ0%2fs1600%2fCapture%2bd%e2%80%99%c3%a9cran%2b2013-09-13%2b%c3%a0%2b16.28.30.png&ehk=mPZxTJtj1EQqJ9vsnEETKlmJCWhvaL1JAra9bcGX5zs%3d&risl=&pid=ImgRaw&r=0">Ruspina</NavLogo>
            </NavbarContainer>
        </Nav>
    </>
  )
}

export default Navbar;
